    r"""The harsh acceleration setting type. This setting influences the acceleration sensitivity from which a <a href=\"https://kb.samsara.com/hc/en-us/articles/360043051792-Safety-Event-Overview\" target=\"_blank\">harsh event</a> is triggered. **By default**, this setting is inferred by the Samsara Vehicle Gateway from the engine computer, but it may be set or updated through the Samsara Dashboard or the API at any time. If set to `off`, then no acceleration based harsh events are triggered for the vehicle. Valid values: `passengerCar`, `lightTruck`, `heavyDuty`, `off`, `automatic`."""

    license_plate: Annotated[Optional[str], pydantic.Field(alias="licensePlate")] = None
    r"""The license plate of the Vehicle. **By default**: empty. Can be set or updated through the Samsara Dashboard or the API at any time."""

    name: Optional[str] = None
    r"""The human-readable name of the Vehicle. This is set by a fleet administrator and will appear in both Samsaraâ€™s cloud dashboard as well as the Samsara Driver mobile app. **By default**, this name is the serial number of the Samsara Vehicle Gateway. It can be set or updated through the Samsara Dashboard or through the API at any time."""

    notes: Optional[str] = None
    r"""These are generic notes about the Vehicle. Empty by default. Can be set or updated through the Samsara Dashboard or the API at any time."""

    odometer_meters: Annotated[
        Optional[int], pydantic.Field(alias="odometerMeters")
    ] = None
    r"""A manual override for the vehicle's odometer. You may only override a vehicle's odometer if it cannot be read from on-board diagnostics. When you provide a manual odometer override, Samsara will begin updating a vehicle's odometer using GPS distance traveled since this override was set. See <a href=\"https://kb.samsara.com/hc/en-us/articles/115005273667\" target=\"_blank\">here</a> for more details."""

    static_assigned_driver_id: Annotated[
        Optional[str], pydantic.Field(alias="staticAssignedDriverId")
    ] = None
    r"""ID for the static assigned driver of the vehicle. Setting the value to 0 will unassign the current driver."""

    tag_ids: Annotated[Optional[List[str]], pydantic.Field(alias="tagIds")] = None
    r"""An array of IDs of tags to associate with this vehicle. If your access to the API is scoped by one or more tags, this field is required to pass in."""

    vehicle_regulation_mode: Annotated[
        Optional[VehicleRegulationMode], pydantic.Field(alias="vehicleRegulationMode")
    ] = None
    r"""Whether or not the vehicle is regulated, unregulated (non-CMV), or a mixed use unregulated vehicle. Valid values: `regulated`, `unregulated`, `mixed`."""

    vehicle_type: Annotated[Optional[str], pydantic.Field(alias="vehicleType")] = None
    r"""The type of the vehicle. Only returned for customers with commercial speed limits (CSL) enabled."""

    vin: Optional[str] = None
    r"""The VIN of the Vehicle. Most of the time, this will be automatically read from the engine computer by the Samsara Vehicle Gateway. It will be empty if it cannot be read. It can be set or updated through the Samsara Dashboard or the API at any time."""
